/*
2945. Find Maximum Non-decreasing Array Length
Hard
Topics
Companies
Hint

You are given a 0-indexed integer array nums.

You can perform any number of operations, where each operation involves selecting a subarray of the array and replacing it with the sum of its elements. For example, if the given array is [1,3,5,6] and you select subarray [3,5] the array will convert to [1,8,6].

Return the maximum length of a non-decreasing array that can be made after applying operations.

A subarray is a contiguous non-empty sequence of elements within an array.



Example 1:

Input: nums = [5,2,2]
Output: 1
Explanation: This array with length 3 is not non-decreasing.
We have two ways to make the array length two.
First, choosing subarray [2,2] converts the array to [5,4].
Second, choosing subarray [5,2] converts the array to [7,2].
In these two ways the array is not non-decreasing.
And if we choose subarray [5,2,2] and replace it with [9] it becomes non-decreasing.
So the answer is 1.

Example 2:

Input: nums = [1,2,3,4]
Output: 4
Explanation: The array is non-decreasing. So the answer is 4.

Example 3:

Input: nums = [4,3,2,6]
Output: 3
Explanation: Replacing [3,2] with [5] converts the given array to [4,5,6] that is non-decreasing.
Because the given array is not non-decreasing, the maximum possible answer is 3.



Constraints:

    1 <= nums.length <= 10^5
    1 <= nums[i] <= 10^5

*/

#include <iostream>
#include <vector>
#include <cassert>
#include <algorithm>
#include <map>
#include <queue>
#include <chrono>

using namespace std;

#define __DEBUG_LOG 1

void printVector(vector<int> &nums)
{
    for (size_t i = 0; i < nums.size(); i++)
    {
        cout << nums[i] << " ";
    }
    cout << endl;
}

class state
{
public:
    size_t idx;
    int length;
    int sum;

    state(size_t idx, int length, int sum) : idx(idx), length(length), sum(sum) {}
    void print()
    {
        cout << "[" << idx << "] l:" << length << ", s:" << sum << "\t";
    }
};
class Solution
{
    size_t end;
    vector<int> sumcache;
    vector<map<int, int>> dp;

public:
    int findMaximumLength(vector<int> &nums)
    {
        end = nums.size();
        if (end < 2)
        {
            return 1;
        }
        if (end > 100)
            end = 1000;
        sumcache.clear();
        dp.clear();
        sumcache.resize(end, 0);
        dp.resize(end, map<int, int>());

        return process(nums);
    }
    int process(vector<int> &nums)
    {
        queue<state> q;
        int result = 0;
        sumcache[end - 1] = nums[end - 1];

        for (size_t i = end - 2; i; i--)
        {
            sumcache[i] = sumcache[i + 1] + nums[i];
        }

        int sum = nums[0];
        int length = 1;
        for (size_t i = 1; i < end; i++)
        {
            dp[i - 1][sum] = length;

            q.push(state(i, length, sum + nums[i]));
            length++;
            if (sum <= nums[i])
            {
                sum = nums[i];
                dp[i][sum] = length;
                result = max(result, length);
            }
            else if (sum >= sumcache[i])
            {
                i = end;
            }
            else
            {
                int cursum = 0;
                for (; i < end; i++)
                {
                    cursum += nums[i];
                    if (cursum >= sum)
                    {
                        sum = cursum;
                        dp[i][sum] = length;
                        result = max(result, length);

                        break;
                    }
                }
            }
        }

        if (__DEBUG_LOG)
            cout << "Processing data of size " << end << " with 1st pass result " << result << endl;

        int cachehit = 0;
        int processed = 0;
        while (!q.empty())
        {
            size_t qsize = q.size();
            // if (qsize % 10 == 0 || qsize < 10)
            //    cout << "queue size: " << qsize << " cache hit: " << cachehit << " processed: " << processed << " result: " << result << endl;

            if (__DEBUG_LOG)
            {
                cout << "queue size: " << qsize << " cache hit: " << cachehit << " processed: " << processed << " result: " << result << endl;
                cachehit = 0;
                processed = 0;
            }
            for (size_t qidx = 0; qidx < qsize; qidx++)
            {
                state s = q.front();
                q.pop();

                if (dp[s.idx].find(s.sum) != dp[s.idx].end())
                {
                    if (s.length > dp[s.idx][s.sum])
                    {
                        dp[s.idx][s.sum] = s.length;
                    }
                    else
                    {
                        if (__DEBUG_LOG)
                            cachehit++;
                    }
                    result = max(result, dp[s.idx][s.sum]);
                    continue;
                }
                auto itr = dp[s.idx].upper_bound(s.sum);
                if (itr != dp[s.idx].end() && ((itr->first < s.sum) || itr->second > s.length))
                {
                    if (__DEBUG_LOG)
                        processed++;
                    continue;
                }

                /* if (__DEBUG_LOG)
                    s.print(); */

                size_t i = s.idx + 1;
                int lastSum = s.sum;
                int lastLen = s.length;

                if ((i == end) || (lastSum > sumcache[i]))
                {
                    if (__DEBUG_LOG)
                        processed++;
                    result = max(result, lastLen);
                    dp[i - 1][lastSum] = lastLen;
                    continue;
                }
                if (lastLen + int(end - i) < result)
                {
                    if (__DEBUG_LOG)
                        processed++;
                    continue;
                }

                // 3 cases
                // next: next number as expected
                // next added to lastSum
                // next 'n' digits added to get next number
                int next = nums[i];

                if (lastSum <= next)
                {
                    if (dp[i].find(next) == dp[i].end())
                        q.push(state(i, lastLen + 1, next));
                    else
                        result = max({result, lastLen + 1, dp[i][next]});
                }
                else if (lastSum <= sumcache[i])
                {
                    int curSum = 0;
                    int j = i;
                    while (lastSum > curSum)
                    {
                        curSum += nums[j];
                        j++;
                    }
                    q.push(state(j - 1, lastLen + 1, curSum));
                }
                if (dp[i].find(lastSum + next) == dp[i].end())
                {
                    q.push(state(i, lastLen, lastSum + next));
                }
                else
                    result = max({result, lastLen, dp[i][lastSum + next]});
            }
        }
        return result;
    }
};

void test1(int testID)
{
    Solution s;
    cout << "test" << testID << endl;
    auto nums = vector<vector<int>>({{5, 2, 2},
                                     {1, 2, 3, 4},
                                     {4, 3, 2, 6},
                                     {103, 652, 579},
                                     {247, 173, 316},
                                     {425, 35, 409, 368, 476},
                                     {671, 564, 873, 793},
                                     {231, 123, 42, 572, 638, 993, 755, 231, 899, 389}});

    vector<int> expected = {
        1,
        4,
        3,
        2,
        2,
        3,
        2,
        5};

    for (size_t i = 0; i < nums.size(); i++)
    // for (size_t i = nums.size() - 1; i < nums.size(); i++)
    {
        cout << "loop:" << i << endl;

        printVector(nums[i]);
        cout << " " << endl;

        auto result = s.findMaximumLength(nums[i]);
        cout << result << " " << expected[i] << endl;
        assert(result == expected[i]);
    }
}

